import React, { useEffect, useState } from "react";
import axios from "axios";

const TodoDetail = () => {
  const [list, setList] = useState([]);
  useEffect(() => {
    getData();
  }, []);

  const getData = async () => {
    try {
      axios
        .get("http://localhost:3000/todo/detail/1")
        .then((res) => {
          console.log("res: ", res);
          setList(res.data);
        })
        .catch((err) => {
          console.log("err: ", err);
        });
    } catch (error) {
      console.log(`error: ${error}`);
    }
  };
  return (
    <div>
      {list.map((item) => (
        <li key={item.id}>{item.title}</li>
      ))}
    </div>
  );
};

export default TodoDetail;
